// src/pages/SeguidorDashboard.js
import React, { useState } from 'react';

function SeguidorDashboard({ events }) {
  const [selectedEvent, setSelectedEvent] = useState(null);
  const [boletasCompradas, setBoletasCompradas] = useState([]);

  const handleSelectEvent = (event) => {
    setSelectedEvent(event);
    // Aquí podrías realizar cualquier lógica adicional al seleccionar un evento
  };

  const handleCompraBoleta = (event, localidad) => {
    // Lógica para comprar una boleta
    console.log(`Comprar boleta para el evento ${event.name}, localidad: ${localidad.name}`);
    // Aquí podrías agregar la lógica para comprar boletas
    // Por ejemplo, podrías agregar la localidad a la lista de boletas compradas
    setBoletasCompradas([...boletasCompradas, { eventId: event.id, localidad }]);
  };

  const handleTransferirBoleta = (boleta) => {
    // Lógica para transferir una boleta
    console.log(`Transferir boleta para el evento ${boleta.eventId}, localidad: ${boleta.localidad.name}`);
    // Aquí podrías agregar la lógica para transferir boletas
    // Por ejemplo, podrías eliminar la boleta de la lista de boletas compradas
    setBoletasCompradas(boletasCompradas.filter(item => item !== boleta));
  };

  return (
    <div className="seguidor-dashboard">
      <h1>Seguidor Dashboard</h1>

      {/* Mostrar lista de eventos */}
      <div className="event-list">
        <h2>Eventos Disponibles</h2>
        <ul>
          {events.map((event) => (
            <li key={event.id}>
              <strong>Nombre:</strong> {event.name} <br />
              <strong>Fecha:</strong> {event.date} <br />
              <strong>Ubicación:</strong> {event.location} <br />
              <button onClick={() => handleSelectEvent(event)}>Ver Detalles</button>
            </li>
          ))}
        </ul>
      </div>

      {/* Detalles del evento seleccionado */}
      {selectedEvent && (
        <div className="selected-event">
          <h2>Detalles del Evento</h2>
          <p><strong>Nombre:</strong> {selectedEvent.name}</p>
          <p><strong>Fecha:</strong> {selectedEvent.date}</p>
          <p><strong>Ubicación:</strong> {selectedEvent.location}</p>

          {/* Mostrar localidades disponibles y opciones para comprar */}
          <div className="localidades">
            <h3>Localidades Disponibles</h3>
            <ul>
              {selectedEvent.localities.map((localidad) => (
                <li key={localidad.id}>
                  <strong>Nombre:</strong> {localidad.name} <br />
                  <strong>Capacidad:</strong> {localidad.capacity} <br />
                  <button onClick={() => handleCompraBoleta(selectedEvent, localidad)}>Comprar Boleta</button>
                </li>
              ))}
            </ul>
          </div>
        </div>
      )}

      {/* Mostrar boletas compradas */}
      <div className="boletas-compradas">
        <h2>Boletas Compradas</h2>
        <ul>
          {boletasCompradas.map((boleta, index) => (
            <li key={index}>
              <strong>Evento:</strong> {boleta.eventId} <br />
              <strong>Localidad:</strong> {boleta.localidad.name} <br />
              <button onClick={() => handleTransferirBoleta(boleta)}>Transferir Boleta</button>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default SeguidorDashboard;
